import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { faLinkedin, faGithub } from "@fortawesome/free-brands-svg-icons";
import '../styles/footer.css';

const Footer = () => {
  return (  
    <div className="footer-container">
      <footer>
        <ul>
            <li>
                <a href="https://github.com/zoyasarow" class="link-info"><FontAwesomeIcon icon={faGithub} /></a>
                <a href="https://www.linkedin.com/in/zoya-sarow-96547b115/?locale=ar_AE" class="link-info"><FontAwesomeIcon icon={faLinkedin} /></a>
                <a href="mailto:zoyasarow@gmail.com" class="link-info"><FontAwesomeIcon icon={faEnvelope} /></a>
            </li>
        </ul>
      </footer>
    </div>   
  );
};

export default Footer;
